        <div id="form-wrapper">
          <form name="task-form">
            <div className="flex-wrapper">
              <div style={{flex:6}}>
              <input type="text" className="form-control" id="title" placeholder="Add task.."></input>
              </div>
              <div style={{flex:1}}>
                <input type="submit" id="submit" className="btn btn-warning"><i></i></input>
              </div>
            </div>
          </form>
        </div>
      </div>
      </div>
    )
  }
}

export default App;
